import React from 'react'
import { CloseIcon, DropdownContainer, Icon, DropdownWrapper, DropdownMenu, DropdownLink, DropdownBtnWrap} from './dropdownElements';
import About from '../../pages/about';
import Portfolio from '../../pages/portfolio';
import Contact from '../../pages/contact';
import Services from '../../pages/services';

export const Dropdown = ({toggle, isOpen}) => {
    return (
        <DropdownContainer isOpen={isOpen} onClick={toggle}>
            <Icon onClick={toggle}>
                <CloseIcon />
            </Icon>

            <DropdownWrapper>
                <DropdownMenu>
                    <DropdownLink to="/" onClick={toggle} > Home</DropdownLink>
                    <DropdownLink to="/About" onClick={toggle} activeStyle>About</DropdownLink>
                    <DropdownLink to="/portfolio" onClick={toggle} activeStyle>Portfolio</DropdownLink>
                    <DropdownLink to="/contact" onClick={toggle} activeStyle>Contact</DropdownLink>
                    <DropdownLink to="/services" onClick={toggle} activeStyle>Services</DropdownLink>
                </DropdownMenu>
                <DropdownBtnWrap>

                </DropdownBtnWrap>
            </DropdownWrapper>

        </DropdownContainer>
    );
};

export default Dropdown;
